import React, { Component } from 'react';
import './Artwork.css';
import { Link } from 'react-router-dom';

import obruc from  '../assets/gridArt/obruc.jpg';
import dubrovnik from '../assets/gridArt/dubrovnik.jpg';
import sardina from '../assets/gridArt/sardina.jpg';
import astronaut from '../assets/gridArt/astronaut.jpg';
import vrana from '../assets/gridArt/vrana.jpg';
import bik from '../assets/gridArt/bik.jpg';
import limunada from '../assets/gridArt/limunada.jpg';
import ucka from '../assets/gridArt/ucka.jpg';
import prasac from '../assets/gridArt/prasac.jpg';
import pasta from '../assets/gridArt/pasta.jpg';
import srce from '../assets/gridArt/srce.jpg';

const GridImage = (prop) => {
  return(
    <div class="col-3 grid-image text-center">
      <img src={prop.src} alt={prop.name} height="100px" width="160px" />
      <p className="image-title mt-1">{prop.name}</p>
    </div>
  );
}

const GridRow = (prop) => {
  return(
    <div class="row mb-4">
      <div class="col-2">&nbsp;</div>
      <div class="col-8 row">{prop.children}</div>
      <div class="col-2">&nbsp;</div>
    </div>    
  )
}

class Artwork extends Component {
  render() {
    return(
      <div className="artwork">
        <GridRow>
          <GridImage src={obruc} name="P.d. Obruč" />
          <GridImage src={dubrovnik} name="Roofs of Dubrovnik" />
          <GridImage src={sardina} name="Fishy Friday" />
          <GridImage src={astronaut} name="Floating astronaut" />
        </GridRow>
        <GridRow>
          <GridImage src={vrana} name="Crow and Poppies" />
          <GridImage src={bik} name="Taurus Moon" />
          <GridImage src={limunada} name="Rijeka's lemonade" />
          <GridImage src={ucka} name="Učka mountain" />
        </GridRow>
        <GridRow>
          <GridImage src={prasac} name="Orwell's Pigs" />
          <GridImage src={pasta} name="Overeating" />
          <GridImage src={srce} name="Leftovers Brooch" />
        </GridRow>
      </div>
    );
  }
}

export default Artwork;
